webpackJsonp([53868719806041],{752:function(e,n){e.exports={data:{markdownRemark:{html:'<p>A number of things have been tweaked recently.  Following is a list.</p>\n<ul>\n<li>Added "rank" command.  Shows your rank and 3 people above and\nbelow you.</li>\n<li>Fame war has been redone.</li>\n<li>Fame all now lists all kills within past 24 hours instead of\njust since last reboot.</li>\n<li>Swim skill has been redone.  The skill is slightly cheaper\nto learn, and those with 0% swim can no longer enter water rooms.</li>\n<li>Autodelete no longer affects L20 characters.  Still works as\nbefore on less than L20.</li>\n<li>Containers are no longer subject to decay upon death.</li>\n</ul>\n<p>More to come shortly.  Thanks to Vakaur and Ingolemo for this work.</p>\n<p>Comments, questions, complaints, mudmail me.</p>\n<p>Azriya</p>',frontmatter:{title:"News 1553",date:"October 09, 2017",author:"Azriya",desc:"Assorted fixes, changes, and updates"}}},pathContext:{path:"/news/1553"}}}});
